import { Link } from "react-router-dom";

const EVENTLIST = [
  {
    id: "e1",
    title: "Programming for everyone",
    date: "2021-05-12",
  },
  {
    id: "e2",
    title: "Networking for introverts",
    date: "2021-05-30",
  },
  {
    id: "e3",
    title: "Networking for extroverts",
    date: "2021-05-30",
  },
  {
    id: "e4",
    title: "Networking for everyone",
    date: "2021-05-30",
  },
];

const EventsPage = () => {
  return (
    <div>
      <h1>Events Page</h1>
    </div>
  );
};

export default EventsPage;
